import React, { Component } from 'react';

var Niyama = {
  "name": "Shaucha",
  "meaning": "Pureness",
  "about": `Shaucha means Pureness. Pureness is basically good vibes void of negativity. When we practice shaucha, we filter out all forms of corruption upon the well being of the mind. Be careful of the things you put into your body and the types of influences you allow to affect your mental being.
We also cleanse our beings with meditation. The more garbled garbage we expose our mind to, the more poorly we project ourselves into this world. Basically what I am saying is,"garbage in, garbage out. If you want your experience in this world to be pleasant, gaurd your mind from inpleasant things"
`
}
class Niyama1 extends Component {
    render() {

      return (
        <div className="NiyamaContainer">
          <p className="Niyama">{Niyama.about}
          </p>
        </div>
      );
    }
  }

export default Niyama1;
